// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract Receiver {
    event From(string info, address from);
    fallback() external {
        emit From("fallback()", msg.sender);
    }

    function outPut() public payable {
        emit From("outPut()", msg.sender);
    }
}

